import { View, Text, ScrollView, Image } from 'react-native'
import React, { useLayoutEffect } from 'react'

import { useNavigation } from '@react-navigation/native'

const HomeScreen = () => {

  const navigation = useNavigation();
  useLayoutEffect(() => {
    navigation.setOptions({
      headerShown: false,
    });
  }, []);
  return (
    <ScrollView>
      <View className="bg-white flex-1 relative px-6 mt-8 ">
        <View className="flex-row ">
          <View>
            <Text className="text-[#FF6813] text-[24px] font-semibold">FLPut App</Text>
            <Text className="text-[18px]">Hi Trung</Text>
          </View>
          <View className="right-0 absolute mt-2">
            <Image source={require('../assets/logoapp.png')} className="w-12 h-12 rounded-full" />
          </View>
        </View>
        <View className="mt-2">
          <Image source={require('../assets/banner.png')} className="max-w-2xl" />

        </View>


      </View>
    </ScrollView>
  )
}

export default HomeScreen
